      out.write("\t\t\t\tdeste laudo pericial e ilustrada por meio de imagens, esquemas\n");
      out.write("\t\t\t\tgr&aacute;ficos e imagens de sat&eacute;lite.</span>\n");
      out.write("\t\t</p>\n");
      out.write("\t\t<p class=\"c21 c26\">\n");
      out.write("\t\t\t<span>Com rela&ccedil;&atilde;o &agrave;\n");
      out.write("\t\t\t\tdetermina&ccedil;&atilde;o do diagn&oacute;stico diferencial do fato,\n");
      out.write("\t\t\t\ttemos que os elementos materiais extr&iacute;nsecos apurados, apontam\n");
      out.write("\t\t\t\ta ocorr&ecirc;ncia de </span><span class=\"c0\">&lt;ocorrencia.tipo_pericia&gt;\n");
      out.write("\t\t\t</span><span>da pessoa identificada como sendo</span><span>&nbsp;</span><span\n");
      out.write("\t\t\t\tclass=\"c0\">&lt;vitima.nome&gt;</span><span>, mediante</span><span\n");
      out.write("\t\t\t\tclass=\"c13\">&nbsp;</span><span class=\"c0\">&lt;laudo.conclusao&gt;</span><span>.</span>\n");
      out.write("\t\t</p>\n");
      out.write("\t\t<p class=\"c21 c26\">\n");
      out.write("\t\t\t<span>Quanto ao palco do evento, &agrave; din&acirc;mica e\n");
      out.write("\t\t\t\t&agrave;s circunst&acirc;ncias do fato, e os meios/instrumentos\n");
      out.write("\t\t\t\tempregados para a consuma&ccedil;&atilde;o do delito, os elementos\n");
      out.write("\t\t\t\tmateriais extr&iacute;nsecos, presentes na cena do crime, permitem\n");
      out.write("\t\t\t\testabelecer as seguintes considera&ccedil;&otilde;es:</span>\n");
      out.write("\t\t</p>\n");
